import {
  AppBar,
  Typography,
  IconButton,
  Toolbar,
  InputBase,
} from "@material-ui/core";
import { Menu, Search,Badge } from "@material-ui/icons";
import "./Topbar.css";
const Topbar = () => {
  return (
    <AppBar position="static">
      <Toolbar>
        <div className="topbar_slider_main">
          <div className="topbar_slider_smalldiv">
            <IconButton>
              <Menu style={{ color: "white" }} />
            </IconButton>
            <Typography variant="h6" noWrap>
              Material-UI
            </Typography>
            <div>
              <Search />
              <InputBase />
            </div>
          </div>

          <div className="topbar_slider_largediv">
            <IconButton>
              <Badge  color="secondary">
                <Notifications style={{ color: "black" }} />
              </Badge>
            </IconButton>
          </div>
        </div>
      </Toolbar>
    </AppBar>
  );
};

export default Topbar;
